A aquisição de acessos simultâneos para uso do sistema Zênite Fácil e do serviço Orientação por Escrito Zênite em Licitações e Contratos é essencial para a otimização da gestão das contratações públicas na SOMAR. A implementação dessas soluções tecnológicas visa:
?	Aprimorar a pesquisa jurídica e a qualificação da elaboração de peças técnicas, garantindo maior segurança jurídica nas decisões;
?	Reduzir falhas procedimentais nos processos de contratação pública, promovendo maior eficiência e agilidade na análise e fiscalização de contratos regidos pela Lei 14.133/2021;
?	Fortalecer o controle interno e as rotinas padronizadas de gestão das contratações, com acesso a base de dados atualizada de legislação, jurisprudência e modelos aplicáveis.
